import './App.css';
import { Login, ProtectedRoute, Dashboard, Contact, Blog } from './Components';
import { Routes, Route } from "react-router-dom";
import React from 'react';

function App() {
  return (
    <Routes>
      <Route path='/'>
        <ProtectedRoute></ProtectedRoute>
      </Route>
      <Route path='/login'>
        <Login></Login>
      </Route>
      <Route
        path="/"
        element={
          <ProtectedRoute>
            <Dashboard></Dashboard>
          </ProtectedRoute>
        } />
      <Route
        path="/blog"
        element={
          <ProtectedRoute>
            <Blog />
          </ProtectedRoute>
        } />
      <Route
        path="/contact"
        element={
          <ProtectedRoute>
            <Contact />
          </ProtectedRoute>
        } />
    </Routes>
  );
}

export default App;
